def geturl(url):
    time = []
    rate = []
    result = requests.get(url)
    soup=BeautifulSoup(result.text,'html.parser')
    text = (soup.findAll('div',attrs='Content')[1].find('table')).findAll('td')
    for i in range(int(len(text)/3)):
        time.append(text[3*i].string)
        rate.append(float(text[3*i+1].string))
    return time,rate
        
